        navigate('/quiz');
    };

    return (
        <div className="home-page">
            <h1>Quizzical</h1>
            <p>Some description if needed</p>
            <button className='btn' onClick={startQuiz}>Start quiz</button>
            {/* <button onClick={startQuiz}>Start Quiz</button> */}
        </div>
    );
}

export default HomePage;
